[0] = colorArray[nu_ind];\nnu_slider.bar_color = colorArray[nu_ind];\nlet phiRb = [];\nlet lam = [];\nlet cpc = [];\nlet gamma = [];\nfor (let i = 0; i &lt; phiRb_range.length; i++) {\n    phiRb.push(phiRb_range[i]);\n    lam.push(steadyStateGrowthRate(gamma_max, phiRb_range[i], nu_max, Kd_cpc, phi_O));\n    cpc.push(steadyStatePrecursorConc(gamma_max, phiRb_range[i], nu_max, Kd_cpc, phi_O) / Kd_cpc);\n    gamma.push(steadyStateGamma(gamma_max, phiRb_range[i], nu_max, Kd_cpc, phi_O));\n}\ndata['phiRb'] = [phiRb];\ndata['cpc'] = [cpc];\ndata['gamma'] = [gamma];\ndata['lam'] = [lam];\nsource.change.emit();\n\n// /////////////////////////////////////////////////////////////////////////////\n// FUNCTIONS DEFINING SELF-REPLICATOR MODEL\n// /////////////////////////////////////////////////////////////////////////////\n\n\nfunction selfReplicator(params,args, dt) { \n    let [M, M_Rb, M_Mb, c_pc, c_nt] = params;\n    let [gamma_max, nu_max, Y, phi_Rb, phi_O, Kd_cpc, Kd_cnt] = args;\n\n    // Compute the transalational efficiency\n    let gamma = gamma_max * (c_pc / (c_pc + Kd_cpc));\n    let nu = nu_max * (c_nt / (c_nt + Kd_cnt));\n\n    // Define the biomass dynamics\n    let dM_dt = gamma * M_Rb;\n    \n    // Define allocation dynamics\n    let dM_Rb_dt = phi_Rb * dM_dt;\n    let dM_Mb_dt = (1 - phi_Rb - phi_O) * dM_dt;\n\n    // Define precursor dynamics\n    let dcpc_dt = (nu * M_Mb - dM_dt * (1 + c_pc)) / M;\n\n    // Define nutrient dynamics\n    let dcnt_dt = -nu * M_Mb / Y;\n    return [dM_dt * dt, dM_Rb_dt * dt, dM_Mb_dt * dt, dcpc_dt * dt, dcnt_dt * dt]\n}\n\n// /////////////////////////////////////////////////////////////////////////////\n// FUNCTIONS DEFINING STEADY-STATE PARAMETERS\n// /////////////////////////////////////////////////////////////////////////////\nfunction steadyStatePrecursorConc(gamma_max, phi_Rb, nu_max, Kd_cpc, phi_O) {\n    let growth_rate = steadyStateGrowthRate(gamma_max, phi_Rb, nu_max, Kd_cpc, phi_O)\n    return (nu_max * (1 - phi_Rb - phi_O) / growth_rate) - 1\n}\n\nfunction steadyStateGrowthRate(gamma_max, phi_Rb, nu_max, Kd_cpc, phi_O) {\n    let Gamma = gamma_max * phi_Rb;\n    let Nu = nu_max * (1 - phi_Rb - phi_O);\n    let numer = Nu + Gamma - Math.sqrt(Math.pow(Nu + Gamma, 2) - 4 * (1 - Kd_cpc) * Nu * Gamma)\n    let denom = 2 * (1 - Kd_cpc);\n    return numer / denom\n}\n\nfunction steadyStateGamma(gamma_max, phi_Rb, nu_max, Kd_cpc, phi_O) {\n    let cpc = steadyStatePrecursorConc(gamma_max, phi_Rb, nu_max, Kd_cpc, phi_O);\n    return gamma_max * (cpc / (cpc + Kd_cpc));\n}\n\n// /////////////////////////////////////////////////////////////////////////////\n// FUNCTIONS DEFINING ALLOCATION STRATEGIES\n// /////////////////////////////////////////////////////////////////////////////\nfunction optimalAllocation(gamma_max, nu_max, Kd_cpc, phi_O) {\n    let prefix = 1 / (4 * Kd_cpc * gamma_max * nu_max - Math.pow(nu_max + gamma_max, 2))\n    let bracket = 2 * Kd_cpc * gamma_max * nu_max - gamma_max * nu_max + Math.sqrt(Kd_cpc * gamma_max * nu_max) * (nu_max - gamma_max) - Math.pow(nu_max, 2)\n    return (1 - phi_O) * prefix * bracket\n}\n\n\n// /////////////////////////////////////////////////////////////////////////////\n// FUNCTIONS FOR NUMERICAL INTEGRATION\n// /////////////////////////////////////////////////////////////////////////////\nfunction odeintForwardEuler(fun, params, args, dt, nSteps) { \n    let out = [params]; \n    for (let i=1; i &lt; nSteps ; i++) { \n        let deriv = fun(out[i-1], args, dt)\n        for (let j=0; j &lt; deriv.length; j++) {\n            deriv[j] = out[i-1][j] + deriv[j];\n        }\n        out.push(deriv);\n    }\n    return out\n}\n\n\n// \n\n// Function for linearly spacing values. Adapted from StackOverflow user mhodges\n// https://stackoverflow.com/questions/40475155/does-javascript-have-a-method-that-returns-an-array-of-numbers-based-on-start-s\nfunction linSpace(startValue, stopValue, nSteps) {\n  let arr = [];\n  let step = (stopValue - startValue) / nSteps;\n  for (var i = 0; i &lt; nSteps; i++) {\n    arr.push(startValue + (step * i));\n  }\n  return arr;\n}\n"},"id":"13065","type":"CustomJS"},{"attributes":{},"id":"12990","type":"LogScale"},{"attributes":{"source":{"id":"12943"}},"id":"13064","type":"CDSView"},{"attributes":{},"id":"13034","type":"WheelZoomTool"},{"attributes":{"data":{"color":["#57a490"],"cpc":[{"__ndarray__":"SWIECBSKxkCnWQH2OcWxQLgSWJhB4aVAW9bifc9Wn0Cd11bNuz2YQF3I7yHzpZNA/TotsuVukEBMmoiPHh2MQEg8gws8dYhA4gyU9QCPhUDAw78s9zODQHlf/49UQIFAyhdZcDg3f0DTHgwE+Gh8QHhYNi22/HlAEdzU+K/fd0AfCWguowN2QE3oyRSIXXRAdsepErTkckDCAmTYP5JxQBb2RzOaYHBA4bAHOXKWbkCVDDFbv5xsQEbzQpjlzWpAm5TCv7AkaUCHynJmvJxnQHs/6vVMMmZArbyELjHiZEC18MILqqljQJOsi4lXhmJAGHtZLSl2YUBRSGF+UXdgQGjP1Zd3EF9A4hOejgdPXUAm37om3adbQI02NADKGFpAOCJ3c92fWED4u/97XDtXQOisjei66VVAPLU4mJWpVECaXQWXrXlTQGhVevXjWFJAYrC+PTZGUUCyhWRuu0BQQLjsBs9Cj05AECnPdFW0TEA0IA6eWe9KQKPslKkcP0lA4jkV7IuiR0BXqQWOshhGQHl8ndO3oERARCmVwt05Q0A2YVMYgONBQD7LJYATnUBA0rLl5knMPkC2K21Jsnw8QC5y5pHXSjpAhjDvA102OECLeK8vDj82QLb/mTrZZDRA5zucI8anMkD1GQJF6gcxQJuUNYWvCi9ArDGGzxJALECEvIZama8pQOuz89JZWCdA/iZ8Bcc4JUC8toGFoU4jQEY/dL7+liFA/Mb5q2QOIEBiiT816WEdQPmZxPo49RpAflhW0ozOGEBns3MfAOYWQFR/5X4uNBVAlrthdlayE0DQNRwSaVoSQHbaPzELJxFAY8aTRo0TEEBwzIoYuzcOQFpiLUbveAxASDXIO6fkCkDIOmloq3UJQOTbJY5+JwhAnHcDB0P2BkCQuGBko94FQMS0ukO+3QRAjjnHEBXxA0Ci8ORefRYDQEbdLYIUTAJAypJrFTWQAUAu40gibuEAQPB8UKp7PgBAwP3RsIBM/z/ofOpVgC/+P/Qhj9w3JP0/LDZAyxop/D/sRwMNyDz7P8jquF0EXvo/0Ej9hLWL+T/ExwA/3sT4P+wJN7iaCPg/EBE9hR1W9z/ofBIEraz2PwAC2RahC/Y/MPnbKmFy9T9EDsGAYuD0P1iuhawmVfQ/lK5jRTrQ8z980+++M1HzP7g/yWWy1/I/yOMKe11j8j+kfmZq4/PxP5RHahf5iPE/tGTzPlki8T8QUzzqw7/wP7yaUvH9YPA/AEUNi9AF8D8w1L/REVzvP2BpPbrvsu4/CPvvFOMP7j+4pSI3mnLtPwifsgPJ2uw/KIJ7dShI7D846h81drrrP9g07zh0Mes/6B/Qbeis6j9gmDlonCzqP0DuYBxdsOk/6IPdnPo36T9QjxjfR8PoP5gL84QaUug/0Iocq0rk5z+wsKS7snnnP9gxXkQvEuc/cFu10J6t5j8wkqbG4UvmP0jOiUba7OU/kCZwDWyQ5T8oTddZfDblP0AhfdLx3uQ/gLkib7SJ5D8YeRNjrTbkP4CpSAnH5eM/2EkG0uyW4z9429AxC0rjP4hSn5EP/+I/4NIuQOi14j/AZmBkhG7iPzAii/DTKOI/UAavl
